import React from "react";
import ReactDOM from "react-dom";
import { BrowserRouter, Route, Switch, Redirect } from "react-router-dom";

import "assets/cssopen-iconic-bootstrap.min.css";
import "assets/cssanimate.css";

import "assets/cssowl.carousel.min.css";
import "assets/cssowl.theme.default.min.css";
import "assets/cssmagnific-popup.css";

import "assets/cssaos.css";

import "assets/cssionicons.min.css";

import "assets/cssbootstrap-datepicker.css";
import "assets/cssjquery.timepicker.css";


import "assets/cssflaticon.css";
import "assets/cssicomoon.css";
import "assets/cssstyle.css";

import Index from "views/Index.jsx";
import UserName from "views/username.jsx";
import Simple from "views/Simple.jsx";
import Language from "views/language.jsx";
import "js/jquery.min.js";
  import "js/jquery-migrate-3.0.1.min.js";
  import "js/popper.min.js";
  import "js/bootstrap.min.js";
  import "js/jquery.easing.1.3.js";
  import "js/jquery.waypoints.min.js";
  import "js/jquery.stellar.min.js";
  import "js/owl.carousel.min.js";
  import "js/jquery.magnific-popup.min.js";
  import "js/aos.js";
  import "js/jquery.animateNumber.min.js";
  import "js/bootstrap-datepicker.js";
  import "js/jquery.timepicker.min.js";
  import "js/scrollax.min.js";
  import "https://maps.googleapis.com/maps/api/js?key=AIzaSyBVWaKrjvy3MaE7SQ74_uJiULgl1JY0H2s&sensor=false";
  import "js/google-map.js";
  import "js/main.js";


ReactDOM.render(

  <BrowserRouter>
    <Switch>
      <Route path="/" exact render={props => <Simple {...props} />} />
      <Route
        path="/UserName"
        exact
        render={props => <UserName {...props} />}
      />
      <Route path="/Simple" exact render={props => <Simple {...props} />} />
      <Route path="/language" exact render={props => <Language {...props} />} />
      <Redirect to="/" />
    </Switch>
  </BrowserRouter>,

  document.getElementById("root")
);
